import React from 'react';
import ReactDOM from 'react-dom';
import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';
import { Card, CardImg, CardText, CardBody, CardTitle, CardSubtitle, CardLink } from 'reactstrap';
import Button from 'react-bootstrap/Button';
import MaterialIcons from 'material-icons-react';
import Figure from 'react-bootstrap/Figure';
import Header from './Components/Header';
import Footer from './Components/Footer';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Table from 'react-bootstrap/Table';
import Tabs from 'react-bootstrap/Tabs';
import Tab from 'react-bootstrap/Tab'
import Sweetalert from 'react-bootstrap-sweetalert';

class EventHandle extends React.Component {
  render() {
    return(
      <Container>
        <Header/>
            <Container style = {{marginTop: "20vh", padding: 0}}>
              <Card width = "10">
                <CardBody>
                  <CardImg width = "0.5" height = "10" src={process.env.PUBLIC_URL + 'images/events_medium.jpg'} alt="Card image cap"/>
                  <CardTitle><CardLink href = "#">Event Name</CardLink></CardTitle>
                  <CardSubtitle>Date, Time</CardSubtitle>
                  <CardText>Event Description</CardText>
                    <div>
                        <Button className="float-left-right">Delete</Button>
                        <Button className="float-right" style = {{}}>Edit</Button>
                    </div>
                </CardBody>
              </Card>
            </Container>
      </Container>
    )
  }
}
export default EventHandle;
